import React from 'react'
import './Header.css'

function Header() {
  return (
    <header>
        {/* left */}
        <div>
            <img
                className='header_icon'
                src='images/W.jpg'
                alt=''
            />
            
        </div>

        {/* middle */}
        <div></div>

        {/* right */}
        <div></div>
    </header>
  )
}

export default Header
